import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
    container_informacoes:{
        height: "100%",
        width: "95%"
    },

    container_inf:{
        marginTop: "5%",
        height: 60,
        backgroundColor: "#323232",
        borderRadius: 8,
        flexDirection: "row"
    },

    inf_titulo:{
        height: "100%",
        width: "50%",
        justifyContent: "center"
    },
})
export default styles
